import React from 'react';
import './SideDrawer.css'

const SideDrawer = props => (
    <nav>
        <ul>
            <li><a href="/">Log In</a></li>
            <li><a href="/">Explore</a></li>
            <li><a href="/">Learning</a></li>
            <li><a href="/">About Us</a></li>
        </ul>
    </nav>
)

export default SideDrawer;
